Information.Subtext:
					The current operational state of the interface.
The Testing(3) state indicates that no operational packets can be passed.
If Admin Status is Down(2) then ifOperStatus should be Down(2).
If Admin Status is changed to Up(1) then ifOperStatus should change to Up(1) if the interface is ready to transmit and receive network traffic;
it should change to Dormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection);
it should remain in the Down(2) state if and only if there is a fault that prevents it from going to the Up(1) state;
it should remain in the Not Present(6) state if the interface has missing (typically, hardware) components.

					The current operational state of the interface.
The Testing(3) state indicates that no operational packets can be passed.
If Admin Status is Down(2) then Operational Status should be Down(2).
If Admin Status is changed to Up(1) then Operational Status should change to Up(1) if the interface is ready to transmit and receive network traffic;
it should change to Dormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection);
it should remain in the Down(2) state if and only if there is a fault that prevents it from going to the Up(1) state;
it should remain in the Not Present(6) state if the interface has missing (typically, hardware) components.
